gC6(){return"In einer Welt, in der die Technologie mit Lichtgeschwindigkeit voranschreitet, ist die Akzeptanz von Innovation entscheidend. Deshalb integrieren wir KI in Titis, nicht um die einzigartige menschliche Note der Elternschaft zu ersetzen, sondern um sie zu erg\xe4nzen. Unsere KI-gest\xfctzte Unterst\xfctzung ist wie ein freundlicher Begleiter, der Ratschl\xe4ge gibt, Fragen beantwortet und \xfcber die Eigenheiten der Elternschaft schmunzelt."},
gC7(){return"Ich freue mich so, Sie hier zu haben. Titis ist nicht nur eine Plattform; es ist eine Familie. Ein Ort, an dem Sie sich mit anderen Eltern vernetzen, Ihre Erfahrungen teilen und das Wissen und die Unterst\xfctzung sammeln k\xf6nnen, die Sie ben\xf6tigen."},
